                            className={classes.image}
                        />
                </div>
                {text && <p className={classes.text}>{text}</p>}
            </div>
            <div className={classes.footerDivider} />
            <div className={classes.postFooter}>
                <div className={classes.postFooter__leftPart}>
                    <div className={classes.heartIcon}>
                        <HeartIcon/>
